bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bhfrwaetbh vhb46 bh</p>\r\n','bnhtyeru','filtered_html'),(2,'<div class=\"demo\">\r\n<h1>CSS “Always on the bottom” Footer</h1>\r\n\r\n<p>I often find myself designing a website where the footer must rest at the bottom of the page, even if the content above it is too short to push it to the bottom of the viewport naturally.</p>\r\n\r\n<p>However, if the content is taller than the user’s viewport, then the footer should disappear from view as it would normally, resting at the bottom of the page (not fixed to the viewport).</p>\r\n\r\n<p>If you know the height of the footer, then you should set it explicitly, and set the bottom padding of the footer’s parent element to be the same value (or larger if you want some spacing).</p>\r\n\r\n<p>This is to prevent the footer from overlapping the content above it, since it is being removed from the document flow with position: absolute;.</p>\r\n</div>\r\n\r\n<div class=\"footer\">This footer will always be positioned at the bottom of the page, but <strong>not fixed</strong>.</div>\r\n\r\n<p>&nbsp;</p>\r\n','footer1','full_html');
