INSERT INTO `field_data_body` VALUES ('node','page',0,4,4,'und',0,'<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n','','filtered_html'),('node','test',0,11,11,'und',0,'<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum</p>\r\n','','full_html'),('node','testimonial',0,15,15,'und',0,'<p>I signed up for Enchanting Copywriting hoping to improve my business website … But I left with vastly more. I learned how to write specifically for my niche. I learned writing formulas I can apply to anything from a simple email subject title to a full blown ebook. I learned how to use content to engage web visitors and get them on my email list, so I get an opportunity to sell our Point of Sales services (which is not a quick buying decision).</p>\r\n','','full_html'),('node','testimonial',0,16,16,'und',0,'<p>I signed up for Enchanting Copywriting hoping to improve my business website …</p>\r\n\r\n<p>But I left with vastly more.</p>\r\n\r\n<p>I learned how to write specifically for my niche. I learned writing formulas I can apply to anything from a simple email subject title to a full blown ebook. I learned how to use content to engage web visitors and get them on my email list, so I get an opportunity to sell our Point of Sales services (which is not a quick buying decision).</p>\r\n','','filtered_html'),('node','page',0,17,17,'und',0,'<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum</p>\r\n\r\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it loo